import styled from "styled-components";

export const Wrap = styled.header`
  display: flex;
  flex-direction: column;
  justify-content: center;
  height: 100%;
  background-color: #fff;
  max-width: 1276px;
  width: 100%;
  padding: 80px;
`;

export const Container = styled.div`
  display: flex;
  flex-wrap: wrap;
  max-width: 1276px;
  width: 100%;
  gap: 50px 20px;
`;

export const Title = styled.p`
  font-size: 1.5rem;
  margin: 23px auto;
`;
